import React from "react"
import DisplayDeck from "./DisplayDeck"

export default function deckList({decks, deleteDeck}){
    return (
        <div>
            {decks.map((deck) => <DisplayDeck deck={deck} deleteDeck={deleteDeck()} deckPage={false} />)}
        </div>
    )
}
